import React, { useState } from 'react';

function CreateMentor() {
  const [formData, setFormData] = useState({
    name: '',
    expertise: '',
    experience: '',
    education: '',
    currentRole: '',
    company: '',
    bio: ''
  });
  const [skills, setSkills] = useState([]);
  const [newSkill, setNewSkill] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const addSkill = () => {
    if (newSkill.trim() && !skills.includes(newSkill.trim())) {
      setSkills([...skills, newSkill.trim()]);
      setNewSkill('');
    }
  };

  const removeSkill = (skillToRemove) => {
    setSkills(skills.filter(skill => skill !== skillToRemove));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
  };

  return (
    <div className="create-mentor-container">
      <h2>Become a Mentor</h2>
      
      <form onSubmit={handleSubmit} className="mentor-form">
        <div className="form-section">
          <h3>Personal Information</h3>
          <div className="form-group">
            <label htmlFor="name">Full Name</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="currentRole">Current Role</label>
            <input
              type="text"
              id="currentRole"
              name="currentRole"
              value={formData.currentRole}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="company">Company</label>
            <input
              type="text"
              id="company"
              name="company"
              value={formData.company}
              onChange={handleChange}
              required
            />
          </div>
        </div>

        <div className="form-section">
          <h3>Expertise & Skills</h3>
          <div className="form-group">
            <label htmlFor="expertise">Area of Expertise</label>
            <select
              id="expertise"
              name="expertise"
              value={formData.expertise}
              onChange={handleChange}
              required
            >
              <option value="">Select expertise</option>
              <option value="software-development">Software Development</option>
              <option value="data-science">Data Science</option>
              <option value="ui-ux">UI/UX Design</option>
              <option value="cloud">Cloud Architecture</option>
              <option value="cybersecurity">Cybersecurity</option>
            </select>
          </div>

          <div className="form-group">
            <label>Skills</label>
            <div className="skills-container">
              {skills.map((skill, index) => (
                <div key={index} className="skill-tag">
                  {skill}
                  <button type="button" onClick={() => removeSkill(skill)}>Ã—</button>
                </div>
              ))}
            </div>
            <div className="add-skill-input">
              <input
                type="text"
                value={newSkill}
                onChange={(e) => setNewSkill(e.target.value)}
                placeholder="Add a skill"
              />
              <button type="button" className="add-skill-button" onClick={addSkill}>
                Add
              </button>
            </div>
          </div>
        </div>

        <div className="form-section">
          <h3>Experience & Background</h3>
          <div className="form-group">
            <label htmlFor="experience">Years of Experience</label>
            <input
              type="number"
              id="experience"
              name="experience"
              value={formData.experience}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="education">Education</label>
            <input
              type="text"
              id="education"
              name="education"
              value={formData.education}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="bio">Bio</label>
            <textarea
              id="bio"
              name="bio"
              value={formData.bio}
              onChange={handleChange}
              placeholder="Tell us about yourself and your mentoring style..."
              required
            />
          </div>
        </div>

        <button type="submit" className="submit-button">
          <span className="material-icons">person_add</span>
          Submit Application
        </button>
      </form>
    </div>
  );
}

export default CreateMentor;
